import React, { useState, useEffect, useRef } from 'react';
import './Contact.css';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitStatus, setSubmitStatus] = useState(null);
  const contactRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('visible');
          }
        });
      },
      { threshold: 0.1 }
    );

    if (contactRef.current) {
      observer.observe(contactRef.current);
    }

    return () => observer.disconnect();
  }, []);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    
    // Simulera API-anrop
    setTimeout(() => {
      setIsSubmitting(false);
      setSubmitStatus('success');
      setFormData({ name: '', email: '', message: '' });
      
      // Återställ status efter 3 sekunder
      setTimeout(() => setSubmitStatus(null), 3000);
    }, 1000);
  };

  const contactInfo = [
    {
      icon: '📧',
      title: 'E-post',
      value: 'hej@digitorn.se',
      link: 'mailto:hej@digitorn.se'
    },
    {
      icon: '📞',
      title: 'Telefon',
      value: '+46 70 123 45 67',
      link: 'tel:+46701234567'
    },
    {
      icon: '📍',
      title: 'Adress',
      value: 'Storgatan 123, 123 45 Stockholm',
      link: 'https://maps.google.com'
    }
  ];

  const socialLinks = [
    {
      name: 'LinkedIn',
      icon: '💼',
      url: 'https://linkedin.com/company/digitorn'
    },
    {
      name: 'Instagram',
      icon: '📷',
      url: 'https://instagram.com/digitorn'
    }
  ];

  return (
    <section id="contact" className="contact section" ref={contactRef}>
      <div className="container">
        <h2 className="section-title">Kontakta oss</h2>
        <p className="section-subtitle">
          Redo att starta ditt nästa projekt? Vi ser fram emot att höra från dig!
        </p>
        
        <div className="contact-content">
          <div className="contact-info">
            <h3>Låt oss prata</h3>
            <p>
              Har du en idé eller ett projekt du vill diskutera? Vi är här för att hjälpa dig 
              att förverkliga dina digitala visioner. Kontakta oss så återkommer vi inom 24 timmar.
            </p>
            
            <div className="contact-details">
              {contactInfo.map((info, index) => (
                <div key={index} className="contact-detail">
                  <div className="contact-icon">{info.icon}</div>
                  <div className="contact-text">
                    <h4>{info.title}</h4>
                    <a href={info.link} className="contact-link">{info.value}</a>
                  </div>
                </div>
              ))}
            </div>
            
            <div className="social-links">
              <h4>Följ oss</h4>
              <div className="social-icons">
                {socialLinks.map((social, index) => (
                  <a 
                    key={index} 
                    href={social.url} 
                    className="social-link"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    <span className="social-icon">{social.icon}</span>
                    <span className="social-name">{social.name}</span>
                  </a>
                ))}
              </div>
            </div>
          </div>
          
          <div className="contact-form-container">
            <form className="contact-form" onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="name">Namn</label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                  required
                  placeholder="Ditt namn"
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="email">E-post</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                  placeholder="din@epost.se"
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="message">Meddelande</label>
                <textarea
                  id="message"
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  required
                  rows="5"
                  placeholder="Berätta om ditt projekt..."
                ></textarea>
              </div>
              
              <button 
                type="submit" 
                className={`btn btn-primary ${isSubmitting ? 'loading' : ''}`}
                disabled={isSubmitting}
              >
                {isSubmitting ? 'Skickar...' : 'Skicka meddelande'}
              </button>
              
              {submitStatus === 'success' && (
                <div className="submit-success">
                  Tack för ditt meddelande! Vi återkommer snart.
                </div>
              )}
            </form>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
